import { ReactNode } from 'react';

const PanelBody = ({
	className,
	children,
}: {
	className?: string;
	children?: ReactNode;
}) => {
	return (
		<div
			className={
				'col-span-5 w-full pt-3 overflow-hidden overflow-y-scroll h-full scrollbar-thin' +
				(className ? ` ${className}` : '')
			}
		>
			{children && children}
		</div>
	);
};

const PanelMain = ({
	ref,
	className,
	children,
}: {
	ref?: React.RefObject<HTMLDivElement>;
	className?: string;
	children?: ReactNode;
}) => {
	return (
		<div
			className={
				'w-full grid grid-cols-6 gap-6 pt-3' +
				(className ? ` ${className}` : '')
			}
		></div>
	);
};

export { PanelBody };
